import React, { useEffect, useState } from 'react'
import { fetchStaticCountWordsFromAPI } from '../../api/StaticData'
import WordCloud from '../charts/WordCloud'
import DonutChart from '../charts/PieChart'
import PieChart from '../charts/PieChart'
import MultiLevelPieChart from '../charts/PieChart'

const WordCloudPage = () => {
  const [wordCloudData, setWordCloudData] = useState([])

  useEffect(() => {
    const fetchWordCloudData = async () => {
      try {
        const fetchedData = await fetchStaticCountWordsFromAPI()
        setWordCloudData(fetchedData)
      } catch (error) {
        console.error('Error fetching word cloud data:', error)
      }
    }

    fetchWordCloudData()
  }, [])

  const data = {
    children: [
      {
        semantic: 'AFFIRM',
        type: 'INPUT',
        value: 18,
      },
      {
        semantic:
          'I AM GLAD YOU LIKED MY SUGGESTION, I WILL PLAY THE SONG THEN',
        type: 'OUTPUT',
        value: 10,
      },
      {
        semantic: 'AFFIRM',
        type: 'ERROR',
        value: 6,
      },
      {
        semantic:
          ' Ola I AM GLAD YOU LIKED MY SUGGESTION, I WILL PLAY THE SONG THEN',
        type: 'OUTPUT',
        value: 2,
      },
    ],
  }

  return <MultiLevelPieChart data={data} />
}

export default WordCloudPage
